class point:
	def __init__(self, x, y, name):
		self.x = x
		self.y = y
		self.name = name

def get_packages_of_level(files_names, level):
	packages = set()
	for f in files_names:
		packages.add("/".join(f.split("/")[:level]))
	return packages

def distance(p1, p2):
	import math
	return math.sqrt((p1.x - p2.x)**2 + (p1.y - p2.y)**2)

def trace_to_points(trace):
	return [point(x, y, name) for x, y, name in zip(trace['x'], trace['y'], trace['text'])]
	
def points_by_packages(points, package_level):
	packages = {}
	for p in points:
		package = "/".join(p.name.split("/")[:package_level])
		packages.setdefault(package, []).append(p)
	return packages


def calculate_mean_distance_in_package(package):
	sum = 0.0
	count = 0
	for ind, p1 in enumerate(package):
		for p2 in package[ind:]:
			count += 1
			sum += distance(p1, p2)
	return sum/count, count
	
def trace_to_distances(trace, level):
	packages = points_by_packages(trace_to_points(trace), level)
	distances = {}
	for p in packages:
		distances[p] = calculate_mean_distance_in_package(packages[p])
	return distances

